import styled from "styled-components";

const Header = styled.header`
  width: 100%;
  height: 80px;

  display: flex;
  align-items: center;
  justify-content: space-between;

  font-size: 26px;
  background-color: #8C11BE;
  color: #ffffff;

`;

export default Header;
